import React, {useEffect} from "react";
import { Title } from "./components";

import './App.css'
import fetchPosts from "../api/api";

const App = () =>{
    useEffect (()=>{
        fetchPosts().then ((posts)=>{
            console.log(posts);
        })
    })
}

  export default App
